$checkPath = Test-Path "$env:TEMP\procmap"
if($checkPath -eq "True" ){
$imagesFolder = "$env:TEMP\procmap"
#add images here
}
else{
$imagesFolder = mkdir "$env:TEMP\procmap" |Out-Null
}


#Images in base64
$exe = ""



function base64ToImage($imageName,$base64){

$outputImagePath = "$imagesFolder\$imageName"

# Decode base64 string to bytes
$imageBytes = [System.Convert]::FromBase64String($base64)

# Write bytes to a file
$image = [System.IO.File]::WriteAllBytes($outputImagePath, $imageBytes)

}




base64ToImage -imageName "exe.png" -base64 $exe


